import React from 'react';
import styled from 'styled-components';

const ExpenditureFilterBlock = styled.div`
  h1 {
    font-size: 24px;
    color: orange;
  }
`
function ExpenditureFilter() {
  return (
    <>
    <h1>카테고리별로 보기:</h1>
    <select>
      <option>전체</option>
      <option>식사</option>
      <option>교통</option>
    </select>
    </>
  )
}

export default ExpenditureFilter;
